import React, {useEffect, useState} from 'react';

function Joke() {

const [joke, setJoke] = useState({})

    useEffect(() => {
        fetch('https://localhost:30005/jokes/random')
            .then(response => response.json())
            .then(json => {
                console.log('joke json', json);
                setJoke(json)
            });

        console.log('fetching data');
    }, []);

    return (
        <div>
            <h3>Joke</h3>
        </div>
    )
}

export default Joke;
